import React from "react";
import ExpenseItem from "./ExpenseItem";

function ExpenseList(props) {
  return (
    <div>
      {props.items.map((exp) => {
        <ExpenseItem
          title={exp.items.title}
          amount={exp.items.amount}
          date={exp.items.date}
        />;
      })}
    </div>
  );
}

export default ExpenseList;
